class CCTC_CoursePrereq extends CCTC_API_SRVC:HANDLERS:CCTCRequestHandler
   method CCTC_CoursePrereq();
   method getResult(&bindVars As array of any) Returns string;

private
   method errorHandler();
end-class;

method CCTC_CoursePrereq
   %Super = %This;
end-method;

method getResult
   /+ &bindVars as Array of Any +/
   /+ Returns String +/
   /+ Extends/implements CCTC_API_SRVC:HANDLERS:CCTCRequestHandler.getResult +/
   Local string &result;
   Local string &requirementGroup = &bindVars [1];

   Local ApiObject &oSession, &oCctcRqGrpTblEnrl;
   Local ApiObject &oRqGrpTblCollection, &oRqGrpTbl;
   Local ApiObject &oRqGrpDetlTblCollection, &oRqGrpDetlTbl;

   try
      &oSession = %Session;

      &oCctcRqGrpTblEnrl = &oSession.GetCompIntfc(CompIntfc.CCTC_RQ_GRP_TBL_ENRL);
      If &oCctcRqGrpTblEnrl = Null Then
         %This.errorHandler();
         Return &result;
      End-If;

      &oCctcRqGrpTblEnrl.InteractiveMode = False;
      &oCctcRqGrpTblEnrl.GetHistoryItems = True;
      &oCctcRqGrpTblEnrl.EditHistoryItems = False;

      &oCctcRqGrpTblEnrl.RQRMNT_GROUP = &requirementGroup;

      If Not &oCctcRqGrpTblEnrl.Get() Then
         %This.errorHandler();
         Return &result;
      End-If;

      &oRqGrpTbl = &oCctcRqGrpTblEnrl.RQ_GRP_TBL.Item(1);

      Local CCTC_API_SRVC:Util:CIRequest &ci_request = create CCTC_API_SRVC:Util:CIRequest();

      &result = &ci_request.appendResult(&oRqGrpTbl.DESCRLONG);

      &oRqGrpDetlTblCollection = &oRqGrpTbl.RQ_GRP_DETL_TBL;
      Local integer &j;
      For &j = 1 To &oRqGrpDetlTblCollection.Count;
         &oRqGrpDetlTbl = &oRqGrpDetlTblCollection.Item(&j);
         If All(&oRqGrpDetlTbl.CRSE_ID) Then
            &bindVars [1] = &oRqGrpDetlTbl.CRSE_ID;
            Local CCTC_API_SRVC:Util:queryRequest &query_request = create CCTC_API_SRVC:Util:queryRequest("CCTC_CRSE_SUBJECT_NBR", &bindVars);
            Local string &sisCourseId = &query_request.getResult();
         End-If;
         &result = &ci_request.appendResult(&sisCourseId);
         &result = &ci_request.appendResult(LTrim(RTrim(&oRqGrpDetlTbl.DESCR_1)));
         &result = &ci_request.appendResult(&oRqGrpDetlTbl.REQUISITE_TYPE);
      End-For;

      If Not &oCctcRqGrpTblEnrl.Cancel() Then;
         %This.errorHandler();
      End-If;

   catch Exception &ex
   end-try;

   Return &result;
end-method;

method errorHandler
end-method;

