class CCTC_Enrollment extends CCTC_API_SRVC:HANDLERS:CCTCRequestHandler
   method CCTC_Enrollment();
   method getResult(&bindVars As array of any) Returns string;

private
   method errorHandler();
   instance string &error;

end-class;

method CCTC_Enrollment
   %Super = %This;
end-method;

method getResult
   /+ &bindVars as Array of Any +/
   /+ Returns String +/
   /+ Extends/implements CCTC_API_SRVC:HANDLERS:CCTCRequestHandler.getResult +/
   Local ApiObject &oSession;
   Local CCTC_API_SRVC:Util:queryRequest &query_request, &query_request0;
   Local CCTC_API_SRVC:HANDLERS:CCTC_Person &person;
   Local string &result;
   Local string &op = &bindVars.Shift();
   Local string &cccid = &bindVars [1];
   Local string &strm = &bindVars [2];
   Local string &class_nbr = &bindVars [3];

   Local string &institution, &acad_career;

   &query_request = create CCTC_API_SRVC:Util:queryRequest("CCTC_INSTITUTION", &bindVars);
   &institution = &query_request.getResult();

   &query_request = create CCTC_API_SRVC:Util:queryRequest("CCTC_ACAD_CAREER", &bindVars);
   &acad_career = &query_request.getResult();

   Local string &emplid = "";
   If All(&cccid) Then
      &person = create CCTC_API_SRVC:HANDLERS:CCTC_Person();
      &emplid = &person.getEmplidByCccid(&cccid);

      If None(&emplid) Then
         Return "";
      End-If;
   End-If;

   &bindVars [1] = &emplid;
   If None(&emplid) Then
      &bindVars [1] = "%";
   End-If;

   Evaluate &op
   When "get"
      &query_request = create CCTC_API_SRVC:Util:queryRequest("CCTC_ENROLLMENT", &bindVars);
      Local array of string &resultList = &query_request.getResultList();

      Local number &j = 1;
      While (&j <= &resultList.Len)
         &bindVars [1] = &resultList [&j];

         &cccid = "";
         Local string &endDt = "";

         If All(&bindVars [1]) Then
            &bindVars [2] = &resultList [&j + 1];
            &bindVars [3] = &resultList [&j + 10];

            &query_request0 = create CCTC_API_SRVC:Util:queryRequest("CCTC_LAST_ATTENDANCE_DT", &bindVars);
            &endDt = &query_request0.getResult();

            &person = create CCTC_API_SRVC:HANDLERS:CCTC_Person();
            &cccid = &person.getCccidByEmplid(&bindVars [1]);

         End-If;

         Local string &cid = "";
         &bindVars [1] = &resultList [&j + 9];
         If All(&bindVars [1]) Then
            &query_request0 = create CCTC_API_SRVC:Util:queryRequest("CCTC_CID", &bindVars);
            &cid = &query_request0.getResult();
         End-If;

         &resultList.Replace(&j, 1, &resultList [&j], &cccid, &cid, &endDt);

         &j = &j + 15;
      End-While;

      &result = &query_request.getResultFromList(&resultList);

      Return &result;
      Break;
   When "put"

      If None(&emplid) Then
         Return "Unable to find Student ID for " | &cccid;
      End-If;

      &bindVars [1] = &emplid;
      &query_request = create CCTC_API_SRVC:Util:queryRequest("CCTC_ENROLLMENT", &bindVars);
      &resultList = &query_request.getResultList();

      If &resultList.Len = 0 Then
         Return "Enrollment not found " | &emplid;
      End-If;

      Local ApiObject &oCctcStdntEnrl;
      Local ApiObject &oStdntEnrlCollection, &oStdntEnrl;

      try
         &oSession = %Session;
         &oCctcStdntEnrl = &oSession.GetCompIntfc(CompIntfc.CCTC_STDNT_ENRL);

         If &oCctcStdntEnrl = Null Then
            %This.errorHandler();
            Return "GetCompIntfc(CCTC_STDNT_ENRL) failed";
         End-If;

         &oCctcStdntEnrl.InteractiveMode = False;
         &oCctcStdntEnrl.GetHistoryItems = True;
         &oCctcStdntEnrl.EditHistoryItems = False;

         &oCctcStdntEnrl.EMPLID = &emplid;
         &oCctcStdntEnrl.ACAD_CAREER = &acad_career;
         &oCctcStdntEnrl.INSTITUTION = &institution;
         &oCctcStdntEnrl.STRM = &strm;

         If Not &oCctcStdntEnrl.Get() Then
            %This.errorHandler();
            Return "Error: enrollment not found for " | &emplid;
         End-If;

         &oStdntEnrlCollection = &oCctcStdntEnrl.STDNT_ENRL;

         For &j = 1 To &oStdntEnrlCollection.Count;
            &oStdntEnrl = &oStdntEnrlCollection.Item(&j);

            If &oStdntEnrl.CLASS_NBR_0 = &class_nbr Then
               &oStdntEnrl.OVRD_GRADING_BASIS = "Y";
               &oStdntEnrl.GRADING_BASIS_ENRL = "NOG";
               &oStdntEnrl.ENRL_ACTION_TMP = "D";
               Break;
            End-If;

         End-For;

         If Not &oCctcStdntEnrl.Save() Then;
            %This.errorHandler();
            Return "Error: Save failed";
         End-If;

         If Not &oCctcStdntEnrl.Cancel() Then;
            %This.errorHandler();
            Return "Cancel failed";
         End-If;

      catch Exception &ex1
      end-try;

      Break;
   When "request"

      If None(&emplid) Then
         If &bindVars.Len < 4 Then
            Return "Error: student not found";
         End-If;
         &emplid = &bindVars [4];
      End-If;

      &bindVars [1] = &emplid;
      &query_request = create CCTC_API_SRVC:Util:queryRequest("CCTC_ENROLLMENT", &bindVars);
      &resultList = &query_request.getResultList();

      If &resultList.Len > 2 And
            &resultList [3] = "Enrolled" Then
         Return "already enrolled " | &emplid;
      End-If;

      Local ApiObject &oEnrlRequest;
      Local ApiObject &oEnrlReqDetailCollection, &oEnrlReqDetail;

      try
         &oSession = %Session;

         Local string &requestId = "";

         &oEnrlRequest = &oSession.GetCompIntfc(CompIntfc.ENRL_REQUEST);
         If &oEnrlRequest = Null Then
            %This.errorHandler();
            Return "Error GetCompIntfc(ENRL_REQUEST) failed";
         End-If;

         &oEnrlRequest.InteractiveMode = False;
         &oEnrlRequest.GetHistoryItems = True;
         &oEnrlRequest.EditHistoryItems = False;

         &oEnrlRequest.ENRL_REQUEST_ID = &requestId;
         &oEnrlRequest.EMPLID = &emplid;
         &oEnrlRequest.ACAD_CAREER = &acad_career;
         &oEnrlRequest.INSTITUTION = &institution;
         &oEnrlRequest.STRM = &strm;
         &oEnrlRequest.ENRL_REQ_ACTION = "E";
         &oEnrlRequest.CLASS_NBR = &class_nbr;

         If Not &oEnrlRequest.Create() Then;
            %This.errorHandler();
            Return "Create failed";
         End-If;

         &oEnrlReqDetailCollection = &oEnrlRequest.ENRL_REQ_DETAIL;
         &oEnrlReqDetail = &oEnrlReqDetailCollection.Item(1);

         &oEnrlReqDetail.CLASS_NBR = &class_nbr;
         &oEnrlReqDetail.ENRL_REQ_ACTION = "E";

         If Not &oEnrlRequest.Save() Then;
            %This.errorHandler();
            Return "Error: Save failed";
         End-If;

         &requestId = &oEnrlRequest.ENRL_REQUEST_ID_0;

         If Not &oEnrlRequest.Cancel() Then;
            %This.errorHandler();
            Return "Error: Cancel failed";
         End-If;

      catch Exception &ex
         %This.errorHandler();
         Return &error;
      end-try;

      Return &requestId;
   End-Evaluate;

   Return "";

end-method;

method errorHandler
   Local ApiObject &oSession, &oPSMessageCollection, &oPSMessage;
   Local string &sErrMsgSetNum, &sErrMsgNum, &sErrMsgText, &sErrType;
   &oSession = %Session;
   &oPSMessageCollection = &oSession.PSMessages;
   &oPSMessage = &oPSMessageCollection.Item(1);
   &error = &oPSMessage.Text;
   &oPSMessageCollection.DeleteAll();

end-method;

