class CCTC_Enrollment_Post extends CCTC_API_SRVC:HANDLERS:CCTCRequestHandler
   method CCTC_Enrollment_Post();
   method getResult(&bindVars As array of any) Returns string;

end-class;

method CCTC_Enrollment_Post
   %Super = %This;
end-method;

method getResult
   /+ &bindVars as Array of Any +/
   /+ Returns String +/
   /+ Extends/implements CCTC_API_SRVC:HANDLERS:CCTCRequestHandler.getResult +/
   Local string &requestId = &bindVars [1];

   If All(&requestId) Then
      Local string &X;
      SQLExec("SELECT 'X' FROM PS_ENRL_REQ_HEADER A WHERE A.ENRL_REQUEST_ID = :1", &requestId, &X);

      If &X = "X" Then
         Local number &RETCODE;

         RemoteCall("PSRCCBL", "PSCOBOLPROG", "SRPCERC", "ENRL-REQUEST-ID", &requestId, "RC", &RETCODE);
         Evaluate &RETCODE
         When 12
            Return "Enrollment engine fatal error";
         When-Other
         End-Evaluate;
         /*         SQLExec("SELECT A.ENRL_REQ_PROC_ST FROM PS_ENRL_REQ_HEADER A WHERE A.ENRL_REQUEST_ID = :1", &requestId, &X);
         If &X = "E" Then
            Return "Error: enrollment request " | &requestId;
         End-If;
  */
      Else
         Return &requestId;
      End-If;
   Else
      Return "request ID not found";
   End-If;

   Return "";

end-method;

