class CCTC_Enrollment_Prereq extends CCTC_API_SRVC:HANDLERS:CCTCRequestHandler
   method CCTC_Enrollment_Prereq();
   method getResult(&bindVars As array of any) Returns string;

end-class;

method CCTC_Enrollment_Prereq
   %Super = %This;
end-method;

method getResult
   /+ &bindVars as Array of Any +/
   /+ Returns String +/
   /+ Extends/implements CCTC_API_SRVC:HANDLERS:CCTCRequestHandler.getResult +/
   Local string &result;
   Local string &emplid;
   Local CCTC_API_SRVC:Util:queryRequest &query_request, &query_request0;
   Local CCTC_API_SRVC:HANDLERS:CCTC_Person &person;

   &person = create CCTC_API_SRVC:HANDLERS:CCTC_Person();
   &emplid = &person.getEmplidByCccid(&bindVars [1]);

   If None(&emplid) Then
      Return "";
   End-If;

   &bindVars [1] = &emplid;

   &query_request = create CCTC_API_SRVC:Util:queryRequest("CCTC_ENRL_PREREQ", &bindVars);
   Local array of string &resultList = &query_request.getResultList();

   Local string &status = "Complete";
   Local string &descr = "No Prereq";

   If &resultList.Len > 0 Then
      &status = &resultList [1];
      &descr = &resultList [2];

      Evaluate &resultList [1]
      When "COND"
         &status = "Pending";
         Break;
      When "FAIL"
         &status = "Incomplete";
         Break;
      When-Other
         &status = "Other";
      End-Evaluate;
   End-If;

   Local CCTC_API_SRVC:Util:CIRequest &ci_request = create CCTC_API_SRVC:Util:CIRequest();

   &result = &ci_request.appendResult(&status);
   &result = &ci_request.appendResult(&descr);

   Return &result;

end-method;

