class CCTC_FAUnits extends CCTC_API_SRVC:HANDLERS:CCTCRequestHandler
   method CCTC_FAUnits();
   method getResult(&bindVars As array of any) Returns string;

private
   method errorHandler();
end-class;

method CCTC_FAUnits
   %Super = %This;
end-method;

method getResult
   /+ &bindVars as Array of Any +/
   /+ Returns String +/
   /+ Extends/implements CCTC_API_SRVC:HANDLERS:CCTCRequestHandler.getResult +/
   Local string &result = "";
   Local string &yes;
   Local CCTC_API_SRVC:Util:queryRequest &query_request, &query_request0;
   Local string &op = &bindVars.Shift();
   Local string &cccid = &bindVars [1];
   Local string &emplid;
   Local string &term = &bindVars [2];

   &query_request = create CCTC_API_SRVC:Util:queryRequest("CCTC_FAUNIT_STG", &bindVars);
   &result = &query_request.getResult();

   Evaluate &op
   When "get"
      Return &result;
      Break;
   When "post"
      &bindVars [1] = &bindVars [3];
      &query_request = create CCTC_API_SRVC:Util:queryRequest("CCTC_CRSE_BY_CID", &bindVars);
      Local string &crse_id = &query_request.getResult();
      &bindVars [7] = &crse_id;

      Local string &class_nbr, &title;
      SQLExec("SELECT A.CLASS_NBR, A.DESCR FROM PS_CLASS_TBL A WHERE A.CRSE_ID = :1 AND A.STRM = :2", &crse_id, &term, &class_nbr, &title);
      &bindVars [8] = &class_nbr;
      &bindVars [9] = &title;

      &bindVars [1] = &cccid;
      Local CCTC_API_SRVC:Util:insertRequest &insert_request = create CCTC_API_SRVC:Util:insertRequest("CCTC_INSERT_FAUNIT_STG", &bindVars);
      &result = &insert_request.getResult();
      If &result <> "1" Then
         Return &result;
      End-If;
      Break;
   When "delete"
      SQLExec("DELETE PS_CCTC_FAUNIT_STG WHERE CCTC_CCCID = :1 AND STRM = :2 AND CCTC_CID = :3 AND CCTC_MIS_CD2 = :4", &bindVars [1], &bindVars [2], &bindVars [3], &bindVars [4]);
      Break;
   End-Evaluate;

   Return "";
end-method;

method errorHandler
end-method;

