method getResult
   /+ &bindVars as Array of Any +/
   /+ Returns String +/
   /+ Extends/implements CCTC_API_SRVC:HANDLERS:CCTCRequestHandler.getResult +/
   Local string &emplid, &cccid;
   Local CCTC_API_SRVC:Util:queryRequest &query_request;
   Local string &result;

   If &bindVars [1] = "post" Then
      &bindVars.Shift();
      &emplid = &bindVars [1];
      &cccid = &bindVars [2];

      If None(&emplid) Or
            None(&cccid) Then
         Return "";
      End-If;

      &query_request = create CCTC_API_SRVC:Util:queryRequest("CCTC_EMPLID", &bindVars);
      &emplid = &query_request.getResult();

      If None(&emplid) Then
         Return "";
      End-If;

      Local string &ext_system = "CID";
      %This.postExternalId(&emplid, &cccid, &ext_system);

      Return &cccid;
   End-If;

   &emplid = &bindVars [1];

   If All(&emplid) Then
      &query_request = create CCTC_API_SRVC:Util:queryRequest("CCTC_EMPLID", &bindVars);
      &emplid = &query_request.getResult();

      If None(&emplid) Then
         Return "";
      End-If;
   End-If;

   &bindVars.Shift();
   &cccid = &bindVars [1];

   If None(&emplid) Then
      If None(&cccid) Then
         /* by EPPN */
         &bindVars.Shift();
         Local string &eppn = &bindVars [1];
         &bindVars [1] = Substring(&eppn, 1, Find("@", &eppn) - 1);

         &query_request = create CCTC_API_SRVC:Util:queryRequest("CCTC_EMPLID_BY_OPRID", &bindVars);
         &emplid = &query_request.getResult();

      Else
         &emplid = %This.getEmplidByCccid(&cccid);
      End-If;
   End-If;

   If None(&emplid) Then
      Return "";
   End-If;

   &bindVars [1] = &emplid;
   If None(&cccid) Then
      &cccid = %This.getCccidByEmplid(&emplid);
   End-If;

   &query_request = create CCTC_API_SRVC:Util:queryRequest("CCTC_OPRID_BY_EMPLID", &bindVars);
   Local string &oprid = &query_request.getResult();

   &query_request = create CCTC_API_SRVC:Util:queryRequest("CCTC_EPPN_SUFFIX", &bindVars);
   Local string &eppn_suffix = &query_request.getResult();

   &query_request = create CCTC_API_SRVC:Util:queryRequest("CCTC_PRIMARY_NAMES", &bindVars);
   &result = &query_request.getResult();

   &result = &query_request.appendResult(&oprid);
   &result = &query_request.appendResult(&eppn_suffix);
   &result = &query_request.appendResult(&cccid);
   &result = &query_request.appendResult(">");

   Return &result;
end-method;

method getCccidByEmplid
   /+ &emplid as String +/
   /+ Returns String +/
   Local array of any &bindVars = CreateArray();
   Local CCTC_API_SRVC:Util:queryRequest &query_request;

   &bindVars [1] = &emplid;
   &query_request = create CCTC_API_SRVC:Util:queryRequest("CCTC_CCCID_BY_EMPLID", &bindVars);
   Local string &cccid = &query_request.getResult();

   If None(&cccid) Then
      &cccid = %This.getExternalId(&emplid, "CID");
   End-If;

   Return &cccid;
end-method;

method getEmplidByCccid
   /+ &cccid as String +/
   /+ Returns String +/
   Local string &emplid;
   Local array of any &bindVars = CreateArray();
   Local CCTC_API_SRVC:Util:queryRequest &query_request;

   &bindVars [1] = &cccid;
   &query_request = create CCTC_API_SRVC:Util:queryRequest("CCTC_EMPLID_BY_CCCID", &bindVars);
   &emplid = &query_request.getResult();

   If None(&emplid) Then
      SQLExec("SELECT A.EMPLID FROM PS_CCTC_EXT_SYSTEM A WHERE A.EFFDT <= %currentdatein AND A.EXTERNAL_SYSTEM_ID = :1 AND A.EXTERNAL_SYSTEM = 'CID'", &cccid, &emplid);
   End-If;

   Return &emplid;

end-method;

method getExternalId
   /+ &emplid as String, +/
   /+ &ext_system as String +/
   /+ Returns String +/
   Local string &ext_id;

   SQLExec("SELECT A.EXTERNAL_SYSTEM_ID FROM PS_CCTC_EXT_SYSTEM A WHERE A.EFFDT <= %currentdatein AND A.EMPLID = :1 AND A.EXTERNAL_SYSTEM = :2", &emplid, &ext_system, &ext_id);

   Return &ext_id;
end-method;

method postExternalId
   /+ &emplid as String, +/
   /+ &ext_id as String, +/
   /+ &ext_system as String +/
   Local Record &cctc_ext_system = CreateRecord(Record.CCTC_EXT_SYSTEM);

   &cctc_ext_system.EMPLID.Value = &emplid;
   &cctc_ext_system.EXTERNAL_SYSTEM_ID.Value = &ext_id;
   &cctc_ext_system.EXTERNAL_SYSTEM.Value = &ext_system;
   &cctc_ext_system.EFFDT.Value = %Date;

   &cctc_ext_system.Insert();
end-method;

