import CCTC_API_SRVC:Util:*;

class CCTC_Section extends CCTC_API_SRVC:HANDLERS:CCTCRequestHandler
   method CCTC_Section();
   method getResult(&bindVars As array of any) Returns string;

end-class;

method CCTC_Section
   %Super = %This;
end-method;

method getResult
   /+ &bindVars as Array of Any +/
   /+ Returns String +/
   /+ Extends/implements CCTC_API_SRVC:HANDLERS:CCTCRequestHandler.getResult +/
   Local string &institution, &acad_career;
   Local string &delimit = ">";
   Local CCTC_API_SRVC:Util:queryRequest &query_request, &query_request0;
   Local string &result = "";
   Local array of string &resultList, &resultList0;
   Local string &sisCrseId = &bindVars [1];
   Local string &sisTermId = &bindVars [2];
   Local string &sisSectionId = &bindVars [3];
   Local string &words = &bindVars [4];
   Local string &where_clause = "";
   Local number &j;
   Local string &sqlstmt;


   &query_request = create CCTC_API_SRVC:Util:queryRequest("CCTC_INSTITUTION", &bindVars);
   &institution = &query_request.getResult();

   &query_request = create CCTC_API_SRVC:Util:queryRequest("CCTC_ACAD_CAREER", &bindVars);
   &acad_career = &query_request.getResult();

   Local SQL &sql = GetSQL(SQL.CCTC_SECTION, &institution, &acad_career, &sisTermId);
   &sqlstmt = &sql.Value;
   &sql.Close();

   If (&sisSectionId = "%" And
         &sisCrseId = "%" And
         All(&words)) Then
      /* search get all sections filtered */

      &sqlstmt = Substitute(&sqlstmt, "CCTC_CLASS_VW", "CCTC_CLASS_SRCH");

      &words = Substitute(&words, "'", "''");
      Local array of string &arr_words = Split(&words, "&");
      Local string &word;
      For &j = 1 To &arr_words.Len
         &word = &arr_words [&j];
         &where_clause = &where_clause | " AND (upper('" | &word | "') in (upper(trim(A.SUBJECT)), upper(trim(A.CATALOG_NBR)), upper(trim(A.SUBJECT) || '-' || trim(A.CATALOG_NBR)), upper(trim(A.CLASS_NBR)), upper(trim(A.LAST_NAME)), upper(trim(A.FIRST_NAME)), upper(trim(A.EMPLID)), upper(trim(A.BLDG_CD)), upper(trim(A.ROOM)), upper(trim(A.LOCATION))) or instr(upper(A.DESCR), upper('" | &word | "'))>0)";
      End-For;

   Else
      If (All(&sisSectionId) And
            &sisSectionId <> "%") Then
         &where_clause = &where_clause | " AND A.CLASS_NBR  = '" | &sisSectionId | "'";
      End-If;

      Local string &sisCourseId = "";
      If (All(&sisCrseId) And
            &sisCrseId <> "%") Then
         /* get all sections by course */
         &query_request = create CCTC_API_SRVC:Util:queryRequest("CCTC_OFFER_CRSE_ID", &bindVars);
         &resultList0 = &query_request.getResultList();

         If &resultList0.Len > 0 Then
            &where_clause = &where_clause | " AND A.CRSE_ID in ('00'";
            For &j = 1 To &resultList0.Len
               &where_clause = &where_clause | ", '" | &resultList0 [&j] | "'";
            End-For;
            &where_clause = &where_clause | ")";

         Else
            Return "";
         End-If;

      End-If;

   End-If;

   &bindVars [1] = &institution;
   &bindVars [2] = &acad_career;
   &bindVars [3] = &sisTermId;

   &query_request = create CCTC_API_SRVC:Util:queryRequest(&sqlstmt | &where_clause, &bindVars);
   &resultList = &query_request.getResultList();

   &j = 1;
   While (&j <= &resultList.Len)
      /* appt dates */
      &bindVars [4] = &resultList [&j + 5]; /* SESSION_CODE */
      &query_request0 = create CCTC_API_SRVC:Util:queryRequest("CCTC_APPT_DATES", &bindVars);
      &resultList0 = &query_request0.getResultList();
      Local string &appt_dates = &resultList0.Join(&delimit, "", "");

      /* crosslist */
      &bindVars [2] = &resultList [&j + 1]; /* CLASS_NBR */
      &query_request0 = create CCTC_API_SRVC:Util:queryRequest("CCTC_XLIST_ID", &bindVars);

      Local string &xlist_id = &query_request0.getResult();
      Local string &primary_xlist_id = "";
      Local string &xlist = "";
      If All(&xlist_id) Then
         &bindVars [2] = &xlist_id; /* XLIST_ID */
         &query_request0 = create CCTC_API_SRVC:Util:queryRequest("CCTC_PRIMARY_XLIST", &bindVars);
         &primary_xlist_id = &query_request0.getResult();

         &query_request0 = create CCTC_API_SRVC:Util:queryRequest("CCTC_XLIST_DETAIL", &bindVars);
         &resultList0 = &query_request0.getResultList();
         &xlist = &resultList0.Join(&delimit, "", "");
      End-If;

      /* Instructor names */
      &bindVars [1] = &resultList [&j]; /* CRSE_ID */
      &bindVars [2] = &resultList [&j + 4]; /* CRSE_OFFER_NBR */
      &bindVars [4] = &resultList [&j + 5]; /* SESSION_CODE */
      &bindVars [5] = &resultList [&j + 6]; /* CLASS_SECTION */

      &query_request0 = create CCTC_API_SRVC:Util:queryRequest("CCTC_CLASS_INSTR_NAMES", &bindVars);
      &resultList0 = &query_request0.getResultList();
      Local string &instructors = &resultList0.Join(&delimit, "", "");

      &query_request0 = create CCTC_API_SRVC:Util:queryRequest("CCTC_CLASS_MTG_PAT", &bindVars);
      &resultList0 = &query_request0.getResultList();
      Local string &meetings = &resultList0.Join(&delimit, "", "");

      &resultList.Replace(&j, 1, &resultList [&j], &appt_dates, &xlist_id, &primary_xlist_id, &xlist, &instructors, &meetings);

      &j = &j + 28;
   End-While;

   &result = &query_request.getResultFromList(&resultList);

   Return &result;

end-method;

