method getResult
   /+ &bindVars as Array of Any +/
   /+ Returns String +/
   /+ Extends/implements CCTC_API_SRVC:HANDLERS:CCTCRequestHandler.getResult +/
   Local string &strStdntGroup = "CE";
   Local string &result = "";
   Local string &yes;
   Local CCTC_API_SRVC:Util:queryRequest &query_request, &query_request0;
   Local string &op = &bindVars.Shift();
   Local string &mis = &bindVars.Shift();
   Local string &cccid = &bindVars [1];
   Local string &emplid;
   Local string &term = &bindVars [2];
   Local string &institution, &acad_career;
   Local integer &j, &k;

   &query_request = create CCTC_API_SRVC:Util:queryRequest("CCTC_INSTITUTION", &bindVars);
   &institution = &query_request.getResult();

   &query_request = create CCTC_API_SRVC:Util:queryRequest("CCTC_ACAD_CAREER", &bindVars);
   &acad_career = &query_request.getResult();

   Local CCTC_API_SRVC:HANDLERS:CCTC_Person &person;

   &person = create CCTC_API_SRVC:HANDLERS:CCTC_Person();
   &emplid = &person.getEmplidByCccid(&bindVars [1]);

   &bindVars [1] = &emplid;
   &query_request = create CCTC_API_SRVC:Util:queryRequest("CCTC_EMPLID", &bindVars);
   &emplid = &query_request.getResult();

   If None(&emplid) Then
      Return "";
   End-If;

   Local string &ce_student = %This.getCEStudent(&emplid, &term);

   Evaluate &op
   When "get"
      &result = &query_request.appendResult(&term);

      If All(&ce_student) Then
         &yes = "Y";
      Else
         &yes = "N";
      End-If;
      &result = &query_request.appendResult(&yes);

      &query_request0 = create CCTC_API_SRVC:Util:queryRequest("CCTC_HAS_ATTENDED_ORIENTATION", &bindVars);
      &yes = &query_request0.getResult();
      If None(&yes) Or
            &yes = "N" Then
         &yes = "N";
      Else
         &yes = "Y";
      End-If;
      &result = &query_request.appendResult(&yes);

      &query_request0 = create CCTC_API_SRVC:Util:queryRequest("CCTC_HAS_MATH_ASSESSMENT", &bindVars);
      &yes = &query_request0.getResult();
      If None(&yes) Or
            &yes = "N" Then
         &yes = "N";
      Else
         &yes = "Y";
      End-If;
      &result = &query_request.appendResult(&yes);

      &query_request0 = create CCTC_API_SRVC:Util:queryRequest("CCTC_HAS_ENGLISH_ASSESSMENT", &bindVars);
      &yes = &query_request0.getResult();
      If None(&yes) Or
            &yes = "N" Then
         &yes = "N";
      Else
         &yes = "Y";
      End-If;
      &result = &query_request.appendResult(&yes);

      &query_request0 = create CCTC_API_SRVC:Util:queryRequest("CCTC_HAS_EDUCATION_PLAN", &bindVars);
      &yes = &query_request0.getResult();
      If None(&yes) Or
            &yes = "N" Then
         &yes = "N";
      Else
         &yes = "Y";
      End-If;
      &result = &query_request.appendResult(&yes);

      &query_request0 = create CCTC_API_SRVC:Util:queryRequest("CCTC_HAS_BOGFW", &bindVars);
      &yes = &query_request0.getResult();
      If None(&yes) Or
            &yes = "N" Then
         &yes = "N";
      Else
         &yes = "Y";
      End-If;
      &result = &query_request.appendResult(&yes);

      &query_request0 = create CCTC_API_SRVC:Util:queryRequest("CCTC_DSPS_ELIGIBLE", &bindVars);
      &yes = &query_request0.getResult();
      If None(&yes) Or
            &yes = "N" Then
         &yes = "N";
      Else
         &yes = "Y";
      End-If;
      &result = &query_request.appendResult(&yes);

      &query_request0 = create CCTC_API_SRVC:Util:queryRequest("CCTC_HAS_HOLD", &bindVars);
      &yes = &query_request0.getResult();
      If None(&yes) Or
            &yes = "N" Then
         &yes = "N";
      Else
         &yes = "Y";
      End-If;
      &result = &query_request.appendResult(&yes);

      &query_request0 = create CCTC_API_SRVC:Util:queryRequest("CCTC_IS_CONCURRENTLY_ENROLLED", &bindVars);
      &yes = &query_request0.getResult();
      If None(&yes) Or
            &yes = "N" Then
         &yes = "N";
      Else
         &yes = "Y";
      End-If;
      &result = &query_request.appendResult(&yes);

      &query_request0 = create CCTC_API_SRVC:Util:queryRequest("CCTC_CA_ADDRESSES", &bindVars);
      &yes = &query_request0.getResult();
      If None(&yes) Or
            &yes = "N" Then
         &yes = "N";
      Else
         &yes = "Y";
      End-If;
      &result = &query_request.appendResult(&yes);

      &query_request0 = create CCTC_API_SRVC:Util:queryRequest("CCTC_VISA_PERMIT_TYPE", &bindVars);
      &result = &query_request.appendResult(&query_request0.getResult());

      &query_request0 = create CCTC_API_SRVC:Util:queryRequest("CCTC_ADM_APPL_STATUS", &bindVars);
      Local string &appStatus;
      Evaluate (&query_request0.getResult())
      When "AP"
      When "WT"
         &appStatus = "ApplicationPending";
         Break;
      When "N"
         &appStatus = "NoApplication";
         Break;
      When "CN"
      When "DC"
      When "DE"
      When "DM"
      When "SP"
         &appStatus = "ApplicationDenied";
         Break;
      When "AC"
      When "AD"
      When "CM"
      When "LA"
      When "PM"
         &appStatus = "ApplicationAccepted";
         Break;
      When-Other
         &appStatus = "NoApplication";
         Break;
      End-Evaluate;
      &result = &query_request.appendResult(&appStatus);

      &query_request0 = create CCTC_API_SRVC:Util:queryRequest("CCTC_REGISTRATION_DATE", &bindVars);
      &result = &query_request.appendResult(&query_request0.getResult());

      &query_request0 = create CCTC_API_SRVC:Util:queryRequest("CCTC_IS_INCARCERATED", &bindVars);
      &yes = &query_request0.getResult();
      If None(&yes) Or
            &yes = "N" Then
         &yes = "N";
      Else
         &yes = "Y";
      End-If;
      &result = &query_request.appendResult(&yes);

      &query_request0 = create CCTC_API_SRVC:Util:queryRequest("CCTC_RESIDENT_STATUS", &bindVars);
      If &query_request0.getResult() = "IS" Then
         &result = &query_request.appendResult("Resident");
      Else
         &query_request0 = create CCTC_API_SRVC:Util:queryRequest("CCTC_IS_AB540", &bindVars);
         If &query_request0.getResult() = "Y" Then
            &result = &query_request.appendResult("AB540");
         Else
            &result = &query_request.appendResult("NonResident");
         End-If;
      End-If;

      &query_request0 = create CCTC_API_SRVC:Util:queryRequest("CCTC_FA_AWARD_BALANCE", &bindVars);
      If Value(&query_request0.getResult()) > 0 Then
         &yes = "Y";
      Else
         &yes = "N";
      End-If;
      &result = &query_request.appendResult(&yes);

      &query_request0 = create CCTC_API_SRVC:Util:queryRequest("CCTC_ACCT_BALANCE", &bindVars);
      &result = &query_request.appendResult(&query_request0.getResult());

      Return &result;
      Break;

   When "postCohort"
      If All(&ce_student) Then
         Return "";
      End-If;

      Local Record &cctc_stdnt_grps = CreateRecord(Record.CCTC_STDNT_GRPS);

      &cctc_stdnt_grps.EMPLID.Value = &emplid;
      &cctc_stdnt_grps.STDNT_GROUP.Value = &strStdntGroup;
      &cctc_stdnt_grps.STRM.Value = &term;
      &cctc_stdnt_grps.LASTUPDDTTM.Value = %Datetime;

      &cctc_stdnt_grps.Insert();

      Return "";

      Break;
   When "deleteCohort"

      If None(&ce_student) Then
         Return "";
      End-If;


      SQLExec("delete ps_cctc_stdnt_grps where EMPLID = :1 AND STRM = :2", &emplid, &term);

      Break;
   End-Evaluate;

   Return "";

end-method;

method getCEStudent
   /+ &emplid as String, +/
   /+ &term as String +/
   /+ Returns String +/
   Local string &ce_student;

   SQLExec("select EMPLID from ps_cctc_stdnt_grps where EMPLID = :1 AND STRM = :2", &emplid, &term, &ce_student);

   Return &ce_student;
end-method;

method errorHandler
end-method;

