import CCTC_API_SRVC:HANDLERS:*;

class CIRequest
   method CIRequest();
   method getResult() Returns string;
   method appendResult(&value As string) Returns string;

private
   instance string &result;
end-class;

/* constructor */
method CIRequest
end-method;

method getResult
   /+ Returns String +/
   Return %This.result;
end-method;

method appendResult
   /+ &value as String +/
   /+ Returns String +/
   %This.result = %This.result | CCTC_ADPT_CMD.DATA_DELIMITER | &value;
   Return %This.result;
end-method;

