import CCTC_API_SRVC:HANDLERS:*;

class insertRequest
   method insertRequest(&sql_name As string, &bindVars As array of any);
   method getResult() Returns string;

private

   instance string &result;

end-class;

/* constructor */
method insertRequest
   /+ &sql_name as String, +/
   /+ &bindVars as Array of Any +/

   Local SQL &sql = GetSQL(@("SQL." | &sql_name), &bindVars);
   If &sql.Status = 0 Then
      &sql.Close();
      &result = "1";
      rem         &result = String(%SqlRows);
   Else
      /* error */
      &result = String(&sql.Status);

   End-If;

end-method;

method getResult
   /+ Returns String +/
   Return &result;
end-method;

