import CCTC_API_SRVC:HANDLERS:*;

class queryRequest
   method queryRequest(&query_name As string, &bindVars As array of any);
   method getResult() Returns string;
   method getResultList() Returns array of string;
   method appendResult(&value As string) Returns string;
   method getResultFromList(&list As array of string) Returns string;

private

   instance string &result;
   instance array of string &result_list;
end-class;

/* constructor */
method queryRequest
   /+ &query_name as String, +/
   /+ &bindVars as Array of Any +/
   Local array of any &params;
   &params = &bindVars;

   Local SQL &sql;

   Local ApiObject &aRunQry = %Session.GetQuery();
   If Not &aRunQry.Open(&query_name, True, False) Then
      If &params.Len > 0 Then
         &sql = CreateSQL(&aRunQry.SQL, &bindVars);
      Else
         &sql = CreateSQL(&aRunQry.SQL);
      End-If;
      &aRunQry.close();
   Else
      If Upper(Substring(&query_name, 1, 6)) = "SELECT" Then
         &sql = CreateSQL(&query_name, &bindVars);
      Else
         &result = "Open query " | &query_name | " failed";
         Return;
      End-If;
   End-If;

   Local array of any &AAny = CreateArrayAny();
   Local number &i;

   &result = "";
   &result_list = CreateArrayRept("", 0);

   While &sql.Fetch(&AAny)
      For &i = 1 To &AAny.Len
         &result = &result | &AAny [&i] | CCTC_ADPT_CMD.DATA_DELIMITER;
         &result_list.Push(&AAny [&i]);
      End-For;
   End-While;
   &sql.Close();

   If Substringb(&result, Len(&result), 1) = CCTC_ADPT_CMD.DATA_DELIMITER Then
      &result = Substring(&result, 1, Len(&result) - 1);
   End-If;

end-method;

method getResult
   /+ Returns String +/
   Return &result;
end-method;

method getResultList
   /+ Returns Array of String +/
   Return &result_list;
end-method;

method appendResult
   /+ &value as String +/
   /+ Returns String +/
   &result = &result | CCTC_ADPT_CMD.DATA_DELIMITER | &value;
   Return &result;
end-method;

method getResultFromList
   /+ &list as Array of String +/
   /+ Returns String +/
   Return &list.Join(CCTC_ADPT_CMD.DATA_DELIMITER, "", "");
end-method;
